import React, { useState, useEffect } from 'react';
import axios from 'axios'; // Import Axios for HTTP requests
import './AddEditProblems.css';
import { useParams, useNavigate } from 'react-router-dom';

export const AddEditProblems = () => {
    const navigate = useNavigate();
    const { id } = useParams();
    const [code, setCode] = useState('');
    const [notes, setNotes] = useState('');
    const [questionName, setQuestionName] = useState('');
    const [question, setQuestion] = useState('');
    const [fetchingQuestion, setFetchingQuestion] = useState(false);
    const [fetchedQuestions, setFetchedQuestions] = useState([]);

    useEffect(() => {
        if (id) {
            axios.get(`http://localhost:5000/api/problems/${id}`)
                .then(response => {
                    const { code, notes, question_name, question } = response.data;
                    setCode(code);
                    setNotes(notes);
                    setQuestionName(question_name);
                    setQuestion(question);
                })
                .catch(error => console.error('Error fetching data:', error));
        }
    }, [id]);

    useEffect(() => {
        const fetchLeetCodeQuestions = async () => {
            if (!questionName.trim()) return;

            setFetchingQuestion(true);
            try {
                const response = await axios.post('http://localhost:5000/fetch-leetcode-titles', {
                    questionName
                }, { withCredentials: true });
                setFetchedQuestions(response.data.questions);
            } catch (error) {
                console.error('Error fetching questions:', error);
            }
            setFetchingQuestion(false);
        };

        const timeoutId = setTimeout(() => {
            fetchLeetCodeQuestions();
        }, 500); // Debounce the input to reduce the number of API calls

        return () => clearTimeout(timeoutId); // Cleanup the timeout if the component unmounts or the value changes
    }, [questionName]);

    const handleSubmit = async () => {
        const payload = { code, notes, questionName, question };
        const url = `http://localhost:5000/api/problems/${id ? id : ''}`;
        try {
            const response = await axios({
                method: id ? 'put' : 'post',
                url,
                data: payload,
                withCredentials: true
            });
            navigate(-1); // Navigate back after submission
        } catch (error) {
            console.error('Error saving to MongoDB:', error);
        }
    };

    return (
        <div className="container">
            <h1 className="title">Add/Edit Problems</h1>
            <div className="question_name-section">
                <label htmlFor="question_name">Add Question Name Here:</label>
                <input
                    type="text"
                    id="question_name"
                    placeholder="Type your question name here..."
                    value={questionName}
                    onChange={(e) => setQuestionName(e.target.value)}
                />
            </div>
            {fetchingQuestion && <p>Loading...</p>}
            {fetchedQuestions.length > 0 && (
                <ul>
                    {fetchedQuestions.map((q, idx) => (
                        <li key={idx} onClick={() => setQuestion(q.title)}>
                            {q.title}
                        </li>
                    ))}
                </ul>
            )}
            <div className="question-section">
                <label htmlFor="question">Add Question Here:</label>
                <textarea
                    id="question"
                    placeholder="Type your question here..."
                    value={question}
                    onChange={(e) => setQuestion(e.target.value)}
                />
            </div>
            <div className="code-section">
                <label htmlFor="code">Add Code Here:</label>
                <textarea
                    id="code"
                    placeholder="Type your code here..."
                    value={code}
                    onChange={(e) => setCode(e.target.value)}
                />
            </div>
            <div className="notes-section">
                <label htmlFor="notes">Your Notes:</label>
                <textarea
                    id="notes"
                    placeholder="Write your notes here..."
                    value={notes}
                    onChange={(e) => setNotes(e.target.value)}
                />
            </div>
            <button className="submit-button" onClick={handleSubmit}>Submit</button>
            <button className="go-back-button" onClick={() => navigate(-1)}>Go Back</button>
        </div>
    );
};

export default AddEditProblems;
